response:
"Q0":"Teacher provides protonotation (or solfege syllables) and prompts students to produce the indicated melody, either using a given or chosen starting pitch. I often use this as a point and sing, where I point at the solfege and the class sings together on solfege using a given starting note.

Also, just thought of another activity that I use a LOT and is perhaps the most successful thing I do to develop relative pitch: singing into the key (Karpinski-style)!  This helps students be so much more successful in their sight reading and prepared singing.

My rating is for the first exercise I described here."}
